"""
binarysearch.com :: Longest Repeating Substring
jramaswami
"""


class Solution:

    def solve(self, S):

        def search(length):
            """
            Return True if there are two repeated substrings of
            the given length.
            """

            # Set up a rolling hash.
            K = 41
            P = 1
            curr_hash = 0
            for i in range(length-1, -1, -1):
                curr_hash += (P * ord(S[i]))
                P *= K
            P //= K

            # Set up cache
            cache = set()
            cache.add(curr_hash)

            # Roll the hash through the string.
            start = 1
            while start + length <= len(S):
                end = start + length - 1
                left = ord(S[start-1])
                right = ord(S[end])
                # Remove previous value.
                curr_hash = curr_hash - (P * left)
                # Power up all values in the curr hash.
                curr_hash *= K
                # Add the new item.
                curr_hash += right
                if curr_hash in cache:
                    return True
                cache.add(curr_hash)
                start += 1

            return False

        # Binary search for the answer
        low, high = 1, len(S) - 1
        soln = 0
        while low <= high:
            mid = low + ((high - low) // 2)
            print(mid)
            if search(mid):
                low = mid + 1
                soln = max(soln, mid)
            else:
                high = mid - 1
        return soln


def test_1():
    S = "abcdzabcd"
    expected = 4
    assert Solution().solve(S) == expected


